import React from 'react';
import "./Resume.css";

export default function Resume() {
  return (
    <div>
      <div className='titleID'>Resume</div>

      <div className='firstDiv'>
        Project Experience 
        <hr></hr>

        The Ponderosa Pines <br></br>
        <a href="https://proper-stevo.github.io/ThePonderosaPines/">
        <img src="./img/NPBadge.jpeg" alt="National Forest"></img>
        </a>
        </div>
        <div className='firstDiv'>
        Resume Creator <br></br>
        < a href='https://fierce-ravine-29010.herokuapp.com/'>
        <img src='./img/resume.jpg' alt='Avatar'></img>
        </a>
      </div>
    </div>
  );
}
